window.bookSummaryJSON = "Published almost 10 years ago, <i>Guilty Pleasures</i> marked the debut of a writer who was destined to grow from cult favorite to a major best-selling author. Now, for long-time Anita Blake aficionados and newfound fans, <i>Guilty Pleasures</i> makes its debut in downloadable audio. <p>Listeners will learn how Anita Blake started raising the dead - and killing the undead. And how she met Jean Claude, the master vampire destined to become not only her biggest nemesis but her greatest lover.</p>"; 
